meeting-1/meeting-1.html.body:
Introduction & Build Systems
Welcome to the advanced track! There's a lot of material to cover, but lucky for you, we chopped it up into 7 action-packed lessons!
Prerequisites

Install a code editor i.e. Visual Studio Code
Install Nodejs
Install Google Chrome (if not already installed)

What will we learn?
Each week is a new set of topics. A large majority will focus on Angular 4.
Though we will focus on Angular, many of these topics will carry on to other large applications as well.
Why Angular 4?

Google Community
TypeScript
Framework gaining heavy attraction
Architectural ideas introduced that transcends just one framework.

What's a Build System?
Sometimes you don't want to directly serve your source code, right? And you want to make sure your source files are packaged in a way so that everything is as small as possible, right? And maybe you need to transpile ES2015 or TypeSCript to ES5 for browser compatibility?
A build system allows you to all of the above. You can make sure your web application converts your raw ES2015 files to ES5, minify (reduce file size) and then spit them out into small files.
Build systems may seem like complex applications, but they are actually quite simple to their core. You'll see that as we go along.
What are some examples?

GulpJS
GruntJS
WebPack

How are all of those different?
GulpJS and GruntJS are task runners. As in, you set up some tasks, their build order, then whatever is the end result, gets spit out wherever you'd like.
Webpack is a bit more complex. Webpack is a module-loader. It solves many problems such as:

What if I don't want to spend 4 days trying to figure out how to get asynchronous tasks to work in Gulp?
What if I want to use node_module dependencies in my front-end?
What if I only want to bundle up dependencies that I include?
What if I want to run specific files through specific plugins?

GulpJS Example
let gulp = require('gulp');
let babel = require('gulp-babel');
let jade = require('gulp-jade');
let del = require('del');
gulp.task('build', ['es6', 'jade']);
gulp.task('dev', ['watch', 'build']);
gulp.task('jade', ['clean'], () => {
    return gulp.src('src/index.jade')
        .pipe(jade())
        .pipe(gulp.dest('dist'));
});
gulp.task('clean', () => {
    return del(['dist']);
})
gulp.task('watch', () => {
    gulp.watch('src/*', ['build']);
})
gulp.task('es6', ['clean'], () => {
    return gulp.src('src/app.js')
        .pipe(babel({
            presets: ['es2015']
        }))
        .pipe(gulp.dest('dist'));
});

Generally your code goes into gulpfile.js. You call different tasks you create by typing gulp .
Some things to know:

gulp.task('name-of-task', ['dependency-list'], 'function-to-call')
plugins transform files
pipe is to pipe calls from one plugin to another
src is the starting point
dest is the output point

WebPack Example
const HtmlWebpackPlugin = require('html-webpack-plugin');
const path = require("path");
module.exports = {
    entry: './src/app.js',
    output: {
        filename: 'bundle.js',
        path: path.resolve(__dirname, 'dist')
    },
    module: {
        rules: [
            {
                test: /\.js$/,
                use: 'babel-loader',
                exclude: /node_modules/
            }
        ]
    },
    resolve: {
        extensions: [".js"]
    },
    plugins: [new HtmlWebpackPlugin()]
}

So, webpack is a bit more complicated. Webpack is based on modules.
In your source files you import any node module dependency, and webpack grabs that and bundles it with your source files.
Webpack traces your starting file and follows your dependency tree. Whatever is found by webpack is added to the bundle file.
So a few things are going on here:

plugins are what transform and read your js files
entry is where webpack goes to trace your dependencies
rules are regex matchers
 i. use is the loader that webpack will use to transform your files. Loaders transform files
 ii. test is the regex matcher
HtmlWebpackPlugin generates the index.html with the script tag injected so I don't have to create one

Installing Webpack

npm install -g webpack or sudo npm install -g webpack on *nix machines
Create a webpack.config.js
npm init # If npm hasn't been initialized yet
npm install --save webpack babel-loader babel-presets-es2015
webpack

Workshop
Use the css-loader on your project with webpack!

meeting-2/intro-ts.html.body:
Introduction to TypeScript & Modules
Welcome to meeting 2! We're going over TypeScript and Modules!
WTF is TypeScript?
TypeScript is a superset of JavaScript. It allows you to write the latest JavaScript code, but with types.
This means that you're able to enforce types with all functions, methods, variables, etc.
For example:
let a = 5;
a = "Not 5";

The above example works in JavaScript, but may cause unwanted side-effects.
let a: number = 5;
a = "Not 5"; //ERROR!!!

The above example doesn't work compile-time because you defined a as a number, then tried to reassign the number to a string. That doesn't work!
What does TypeScript introduce?

Strongly Typed language
Interfaces
Types
Classes
Type and parameter enforced functions/methods
Type inference

Type Inference
let num = 5;
num = "Not num"; //ERROR!!!

The above gives you an error because TypeScript assumes that your number will keep its type once assigned.
This works also for non-primitive types!
let obj = {
    param1: 3
};
console.log(obj.param2); //ERROR!!
obj.param2 = 4; //ERROR!!

Once an object is created without a type, it assumes the object won't add any additional parameters. So, when we try to modify/read param2, TypeScript says the property doesn't exist on the object.
Why TypeScript?
The number one reason is to reduce the developer-caused errors. TypeScript makes sure every code written is intended to have the specific type. 
This can be abused by using the any type, but should only be used in specific cases.
Note: TypeScript has all of the same features ES2015 does such as classes, arrow functions, let, etc.
Integrating with webpack
Let's start with the same webpack.config.js we used last time.
const HtmlWebpackPlugin = require('html-webpack-plugin');
const path = require("path");
module.exports = {
    entry: './src/app.ts', //changed to .ts
    output: {
        filename: 'bundle.js',
        path: path.resolve(__dirname, 'dist')
    },
    module: {
        rules: [
            {
                test: /\.js$/,
                use: 'babel-loader',
                exclude: /node_modules/
            },
            { // Added this rule
                test: /\.ts$/,
                use: 'awesome-typescript-loader', // new loader for different type of file
                exclude: /node_modules/
            }
        ]
    },
    resolve: {
        extensions: [".js", ".ts"]
    },
    plugins: [new HtmlWebpackPlugin()]
}

Methods
class Car {
    constructor(speed: number, wheels: number) {
        console.log(speed);
        console.log(wheels);
    }
}
let car: Car = new Car(); //ERROR!! Required two params
let car2: Car = new Car("three", "four"); //ERROR!! Wrong types
let car3: Car = new Car(30,4);

class Car {
    constructor(speed: number, wheels: number) {
        console.log(speed);
        console.log(wheels);
    }
    myMethod() {
        //belongs to Car class
    }
}

myMethod belongs to the Car class. We don't have to put this in front. TypeScript just assumes that it belongs to the Car class. The return type is also inferred from what is returned if anything at all.
Member Variables
class Car {
    speed: number;
    wheels: number;
    constructor(newSpeed: number, newWheels: number) {
        this.speed = newSpeed;
        this.speed = newWheels;
    }
}

Note: You must define every member variable you want to use
If you don't want to manually set the member variables equal to the constructor values, you can do this:
class Car {
    constructor(private speed: number, private wheels: number) { }
}

As long as you give an access modifier, TypeScript will fill the values of the member variables as passed in.
this context
this works the same way as it does in any other C-Based language, so use it as is!
Modules
Each file is treated as a module as long as it exports something.
//car.ts
export class car {
    constructor(private speed: number, private wheels: number) { }
}
//driver.ts
import { Car } from './car';
export class Driver {
    constructor(private car: Car) {
    }
}

The above example has two modules car.ts and driver.ts. Both are modules because something has been exported from each file.
Note: Modules can only be imported if they have been exported in their respective files
//car.ts
class car {
    constructor(private speed: number, private wheels: number) { }
}
//driver.ts
import { Car } from './car'; //NOPE
export class Driver {
    constructor(private car: Car) {
    }
}

The above doesn't work because Car hasn't been exported from car.ts
Note: You can only access variables/methods/classes from other files if they are exported
...
//../models/person-type.ts
export enum PERSON_TYPE {
    DRIVER, PASSENGER
}
//./person.ts
import { PERSON_TYPE } from '../models/person-type';
class Person {
    constructor(private type: PERSON_TYPE) { }
}

**Note: when referring to local modules you've created, use relative paths such as ./ or ../. 
If the modules are from npm, you need to use the package name.
If there's no relative path, your module loader will assume it's from node_modules.
Module Systems
There are different types of module loaders:

SystemJS
AMD
CommonJS
Webpack

This part itself would be a lesson, and it's not the most important thing in web development, so we're just going to summarize: 
NPM uses CommonJS. WebPack supports CommonJS and AMD. All of the module loaders load a slightly different way and deal with module importing/exporting differently.
When you do import { x } from './some-file'; you're actually using a module system. Depending on which module loader you define, Webpack will treat that line of code differently.

meeting-3/intro-angular.html.body:
Introduction to Angular 4
This lesson we'll go over Angular 4 basics!
Why Angular 4?

Backed by Google
Trusted by many important and reputable sites
Latest version of Angular
Based on TypeScript
Stable Framework that allows you to do a lot of stuff
Teaches good architectural lessons every developer should understand
Introduces great build tools

What can Angular do?

Write Complex web apps
Nested client-side routing
Template-Driven web apps
Complex logic built into templates
Built-In CSRF Support
Built-In RxJS support
Observables


AND MORE!

Component-Based Applications
Think of everything as a piece. Angular is made of small moving parts. All you need to do is make them work together.
A component is basically a custom HTML element. is A component has two pieces the template and the logic/class. Each component has a class associated with it, and a template. The template is what is added to the DOM. The template is generally what you use to show things.
Why Components?
Components are reusable. For example, what if you have a component that you'd like to use in multiple places such as an alert? You wouldn't want to copy and paste a hundred lines of code, would you? Of course not, you'd want to just copy and paste the code in some places.
Getting Started
Enough Talk. Let's get started!
First, Create a new project folder!
Go ahead and use the same webpack config file in the angular-project folder Here
Next, create a src folder inside your project. Then, create a main.ts file inside and paste this:
import { platformBrowserDynamic } from '@angular/platform-browser-dynamic';
import { AppModule } from './app/app.module';

import './polyfills';

platformBrowserDynamic().bootstrapModule(AppModule);

Add this to your polyfills.ts file:
import 'zone.js';
import 'reflect-metadata';

We'll come back to this in a second.
Next, create an app folder (inside src) and create a few files app.component.ts and app.module.ts
In app.component.ts
import { Component } from '@angular/core';

@Component({
    template: ` welcome to my angular app! `, //template to show when using component
    selector: `app-component` //how to use this component in html: 
})
export class AppComponent {
}

Modules
Angular is based on a modular system to separate parts of code. 
For example, you can create a new module just for storing common reused components and call the module CommonModule and just import it.
Also, Angular deals with a main module and then imports other dependencies for the rest of the app to use.
For example, if you have 5 separate modules, you need to have your main module import the other 5 to make sure your app works properly.
In app.module.ts let's add some code:
/* Import Statements */
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';

/* Import Main Component */
import { AppComponent } from './app.component'; //Not written yet

@NgModule({ //Tell Angular to create a module
    imports: [
        BrowserModule, // Module for creating angular web apps
        FormsModule // Module to manipulate template
    ],
    declarations: [ // Components created by us
        AppComponent
    ],
    bootstrap: [ AppComponent ]
})
export class AppModule { } // Associate module with class

Run the app
To run the application, run webpack-dev-server!
Note: If you didn't install it already, install webpack-dev-server with npm install -g webpack-dev-server on *nix use sudo npm install -g webpack-dev-server
What just happened?
High Level:

We wrote code
We ran webpack-dev-server
webpack-dev-server performs webpack bundling then watches your source files for any changes.

More Specific:

You have a main module and a main component
Your main module(AppModule) imports your main component (AppComponent)
Angular realizes that you want to use AppComponent and adds your component's template to the DOM.
Note: Wherever you have your component is where the component's template will be added
Because we added the template to the index.html at the top of the body, the contents of the template were added to the DOM inside the body



One-Way Bindings
Angular is based on an MVC model. MVC stands for Model View Controller. 
The model is your data or the state of your application. View is what the user sees. Controller is what connects the model and view together. It's where most of the logic resides.
In our application, the model would be data retrieved from the server or any information created/maintained by our Component. The controller would be our Component class. The View is your component's template.
Because of this, Angular can have one-way bindings. You can reference variables used in your component class inside your template. 
For example, say I had a user's name stored in my UserComponent class. 
class UserComponent {
    userName = "Bob";
}

If you wanted to, you could display that exact name in the template.
@Component({
    template: `  `,
    selector: 'user-component'
})
export class UserComponent {
    userName = "Bob";
}

This is helpful for many reasons, but the main one is that you don't need to manually update your template through your TypeScript.
Also, the double curly brace syntax is for binding. This means that that part of the template is bound to that variable in the Component class. In other words, when userName changes at any point, the header updates.
@Component({
    template: `  `,
    selector: 'user-component'
})
export class UserComponent {
    userName = "Bob";
    constructor() {
        setTimeout(() => this.userName = "Not Bob!", 3000);
    }
}

If you try this what happens?
Bob automatically changes to Not Bob! in the component class, and therefore the template gets updated along with it!
Creating a new component
Go ahead and create a new component inside the app directory.
import { Component } from '@angular/core';
@Component({
    template: `
         Inner Component! 
         My info: 


    `,
    selector: 'inner-component'
})
export class InnerComponent {
    user = {
        name: "John",
        age: 32
    }
}

Now, if we wanted to start displaying this, how would we do it?
Let's think about what we've learned.

Angular imports main module
main module imports dependencies
Angular bootstraps main component
Component is used in index.html so template is put into the DOM there

So, we want to add our inner component to our already existing app, right? And we want to put it below the template for our AppComponent, right? So why don't we just add the  inside the AppComponent template?
@Component({
    template: `


    `, //template to show when using component
    ...
})
...

Try it!
Wait, it didn't work! Angular didn't recognize the component! Well, that's because the component isn't associated with any module! Let's go add it:
...
import { InnerComponent } from './inner.component'; //I named my file inner.component.ts

...
declarations: [
    AppComponent,
    InnerComponent
]
...

DONE!
Now try it!
TL;DR If you want to use a component(Component 2) inside another one(Component 1), add the inner component to the outer component's template (put Component 2 in Component 1's template)!

meeting-5/services-propagation.html.body:
Propagation of data and Intro to Services
So, we've figured out how to propagate data from your parent component to your child component(s)!
What we don't know yet, is how to propagate information from child to your parent component!
Propagation of child component data to parent component
Why would you want to send data to the parent?
Remember how the parent component generally is called the "smart" component? Well, the smart component is supposed to take all of the information from different places and distribute that to other places.
How do we do this?
Before we get started

Create two components VillainList and AddVillain
Move all of the contents used to create a new villain to AddVillain
Input box
Button
Method to add villain


Leave VillainList empty for now

/* add-villain/add-villain.component.ts */
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-add-villain',
  templateUrl: './add-villain.component.html',
  styleUrls: ['./add-villain.component.css']
})
export class AddVillainComponent implements OnInit {
  villainName: string;
  constructor() { }

  ngOnInit() {
  }
  addVillain() {
    this.villains.push(this.villainName); //doesn't work!
    console.log(this.villains); //doesn't work!
  }
}



Add Villain

/* villain-home/villain-home.component.ts */
import { Component, Input, OnInit } from '@angular/core';

@Component({
  selector: 'app-villain-home',
  templateUrl: './villain-home.component.html',
  styleUrls: ['./villain-home.component.css']
})
export class VillainHomeComponent implements OnInit {
  @Input() villains: string[];
  constructor() { }

  ngOnInit() {
  }
}


 Villain Home! 

Purpose of each component:

VillainHome: smart component
Gets updated info from AddVillain


VillainList: list of villains receieved from VillainHome
AddVillain: Get the next villain and send that to VillainHome

Sending villains from VillainHome to VillainList
Remember, @Input() villains: string[]; is a part of VillainHome, but this is for the receiving component, and since VillainList is receiving the list of villains, we need to move the line of code to VillainList.
Next, we need to use the VillainList component inside the VillainHome and send the list of villains to the component as a villains attribute.
...
export class VillainHomeComponent implements OnInit {
  homeVillains = ["Boba Fett", "Darth Vader"];
  constructor() { }

  ngOnInit() {
  }
}


 Villain Home! 


/* villain-list/villain-list.component.ts */
...
export class VillainListComponent implements OnInit {
  @Input() villains: string[];
  constructor() { }

  ngOnInit() {
  }

}



{{villains | json}}

Note: Don't forget to REMOVE this from app.component.html
[villains]="initialVillains"
Passing data from child to parent
We will be passing the event from the child to the parent when the user clicks on the Add Villain button in the AddVillain component.
Let's add an EventEmitter in the AddVillain component.
@Output() add: EventEmitter = new EventEmitter();
The Type is String because we will be sending a string back to the parent. This string is the new villains name.
Next, we alter the click event to emit the string back up to the parent component.
Inside your addVillain be sure to replace the contents with
this.add.emit(this.villainName);
Then, add your app-add-villain to your villain-home.component.html then make sure to add the attribute (click)="addVillain($event)" to the component.
Finally, create the function that will receive the updated name:
/* add-villain/add-villain.component.ts */
addVillain(villainName) {
    this.homeVillains.push(villainName);
}

More built-in directives
Remember how we were talking about NgModel being a directive? There's more than just that!
We have *NgFor, *NgIf, and others.
*NgFor is like a for loop. It's used on an array and for each element in the array, the element and its children will be copied n number of times.












-->




*ngIf is a conditional. If the condition is met, then the element is kept in the DOM. Otherwise it's removed.
Applying to VillainList
Let's apply the same to VillainList, shall we?
We have a list of villains, and we want to display each item in the list, so:




Do you know why we used NgFor on the li and not the ul? It's because if we put ngFor on the ul, then the ul would be copied multiple times, so for each item in the array, we'd have a new list, but we want a list item for each item in the array. That's why we chose to put the NgFor on the li and not the ul
Brackets vs parentheses
Brackets are used when you'd like to evaluate something. For example, when we pass characters or some object, we want to be able to pass in the 
evaluated data, right? Not the actual word characters, so when we're passing data, we need to make sure to put [] around the attribute name.
Also, () means some kind of event being passed or created. For us, we're doing method linking for click events and passing data from child to parent, so we use ().
Services
The purpose of components are to make sure you can reuse UI segments of your web application.
However, it's not a good idea to put large pieces of logic in these components.
Logic should be placed in Services
What is a Service?
A service is a singleton. In other words, once a singleton is instantiated, that object is passed around to the entire system.
There is only a "single" instance of the class.
Where would we want to use a service?
In our Villain Project, we want to move our "state" logic away from the dummy component.
Let's go ahead and move that to a service.
Generate a service:
ng g service main
Then, add it to your list of providers:
providers: [MainService], // don't forget to import MainService!
Let's write a getter, setter, an addVillain, and removeVillain: 
import { Injectable } from '@angular/core';

@Injectable()
export class MainService {
  private villains = [
    "Darth Vader",
    "Darth Plagueis"
  ];
  constructor() { }
  getVillains() {
    return Object.assign({}, this.villains);
  }
  addVillain(villain) {
    this.villains.push(villain);
  }
  removeVillain(villain) {
    let index = this.villains.indexOf(villain);
    if(index > -1) {
      this.villains.splice(index, 1);
    }
  }
}

Now, all we have to do, is tell our smart component, VillainHomeComponent to use the service!
Dependency Injection
DI is an important concept to understand. Sometimes you can have dependencies, but you're not sure how to instantiate them, or you'd like to obfuscate how to instantiate. 
Or, you don't want to have to write unit tests and have to worry about instantiation of other classes.
In these cases, Dependency Injection is a good solution. To inject your dependency, you can:
export class VillainHomeComponent implements OnInit {
  homeVillains = ["Boba Fett", "Darth Vader"];
  constructor(private mainService: MainService) { } // DI happens here

  ngOnInit() {
  }
  addVillain(villain) {
    this.homeVillains.push(villain);
  }

}

See? All we had to do was add the Service to the constructor, and Angular took care of the instantiation of the Service for us!
Now we can use it like a normal object!
We want to replace all instances of managing the villain with the methods used in the service:
...
addVillain(villain) {
    this.homeVillains.push(villain);
}
getVillains() {
    return this.mainService.getVillains();
}



We need getVillains because we need to keep updating the list. Without this method, we'd have no way of getting the list of villains from the service.
